import React from 'react';
import logo from './logo.svg';
import './App.css';

function Titulo(props){
  return(
    <div>{ props.TituloPrincipal }</div>
  )
}


function Cajatexto(){
  return(
    <div><input type="text" name="nombredelacaja" placeholder="Usuario"/></div>
  )
}

function CajatextoPassword(){
  return(
    <div><input type="password" name="txtPassword" placeholder="**********"/></div>
  )
}


class App extends React.Component{
  render(){
    return(
      <div className="App">
      <header className="App-header">
      <div className="App-titulo">
      <Titulo TituloPrincipal="Keymanagefron" subtitulo="0" ></Titulo>
      </div>
      <Titulo TituloPrincipal="Keymanage Juan" subtitulo="0" ></Titulo>

      <Cajatexto></Cajatexto>
      <CajatextoPassword></CajatextoPassword>

      <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload y.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
    </div>
    )
  }
}




export default App;
